mera lets you capture life’s best bits. Plus, a big battery delivers longer talk time, and weeks of standby time  - so you can switch off with confidence.\nKey Features\nColors Sand\nROM :Below 128 MB\nRAM :Below 128 MB\nDisplay Size: 2.8 inch Resolution: QVGA\nImaging Rear camera: 0.3 MP\nPerformance Standby time (Dual SIM, 4G), up to: 19 days Standby time (Dual SIM, 4G), up to: 19.9 days Standby time (Single SIM, 4G), up to: 27 days Standby time (Single SIM, 4G), up to: 27.3 days Talk time (Dual SIM, 4G), up to: 6 h Talk time (Dual SIM, 4G), up to: 6.2 h\nConnectivity Bluetooth: 5.0 Headphone jack: 3.5 mm USB connection: Micro USB (USB 2.0)\nBattery & charging Battery: 1450 mAh, Removable1 Wattage: 2.75 W\nMemory & storage Internal storage: 128 MB MicroSD card support up to: 32 GB RAM: 48 MB\nPlatform CPU: Unisoc T107 Features: Torch, Gameloft Games (Snake, Tetris, BlackJack, Arrow Master, Air Strike, NinjaUp); Origin Data games (Racing Attack - Multiplayer, DOODLE JUMP, CROSSY ROAD, English with Oxford)\nOperating System Operating System: S30+\nAudio Features: MP3 player, FM Radio\nNetworks Max network speed: 4G SIM size: Nano\nButtons Buttons: Power, Numeric keys, Function keys\nDimensions Height: 13.8 mm Length: 131.3 mm Weight: 107 g Width: 56.2 mm\nIn the box Removable Battery User Guide Micro USB Cable',49000.00,1,'02936957-d8dc-406c-b145-b513022fe7e9','2023-10-22 09:00:01','2023-10-22 09:00:01'),('Amazon Fire HD 7 Android Tablet With Alexa -32GB - Black','Colour\nBlack\n\nBrand\n\nScreen size\n1.7 inches\n\nSim Type\nDual Micro SIM\n\nOS\nAndroid OS\n\nRAM\n1 GB\n\nInternal Memory\n32 GB\n\nSim Slots\nDual Micro Sim\n\nBattery Capacity\n4450mAh\n\nThis bundle includes the Fire HD 7 Tablet with Special Offers, 32GB, Yellow and Show Mode Charging Dock for Fire HD 8. The Fire HD 8 is a fast performance tablet with up to 10 hours of battery life, a vibrant 8” HD display, 1.5 GB of RAM and Dolby Audio—made for all day entertainment. Transform your tablet to an immersive, full-screen Alexa experience optimized for visibility across the room. Just ask Alexa to show trending news, timers and alarms, movie showtimes, weather, and more. Dock your tablet to automatically switch to Show Mode. Enjoy movies, TV shows, books, apps, and games while your tablet is docked—or pick it up to take your entertainment on the go.\n\nUp to 12 hours of battery life, a vibrant 8\" HD display, a 1.3 GHz quad-core processor, 1.5 GB of RAM, and Dolby Audio. More durable than the latest iPad.\n16 or 32 GB of internal storage and a microSD slot for up to 256 GB of expandable storage\nJust ask Alexa for quick access to the information and entertainment you want. Ask questions, play music, check your calendar, get the news, weather, and more.\nAsk Alexa to call or message almost anyone, or make video calls to family and friends with a Fire tablet, Echo Spot, Echo Show, or the Alexa App. Instantly connect to enabled Echo devices.\nEnjoy millions of movies, TV shows, songs, Kindle eBooks, apps and games - including Netflix, Facebook, HBO, Spotify, and more\nPrime members get unlimited access to over a thousand books and magazines, millions of songs, and thousands of movies and TV episodes - at no additional cost\nWatch downloaded videos anywhere with a Prime membership, Netflix plan, or Showtime subscription\n\nACCESSORIES:\n\nCharger\nCord\nManual',90000.00,NULL,'02e5d14c-16cc-4e5e-bbe5-c29e0fe8f868','2023-10-22 08:57:48','2023-10-22 08:57:48'),('Privacy Screen Protector Glass For Xiaomi Mi 11 Lite 4g/ 5g','This Tempered Glass screen protector that protects your Phone screen from scuffs, scratches, cracks.\nIt also provides full-screen privacy when your screen is viewed from the side.\nPackage includes\n1 X Tempered Glass Film\n\nPrivacy protection\nSmooth glass treated with a two-way filter that provides full-screen privacy when your screen is viewed from the side.\n\nUse your mobile device in public without revealing confidential information to people on either side\nYou will see the information on your display while people on either side only see a darkened screen\n\nAdhesive-Backed\nA screen protector applies directly to your device screen with a residue-free adhesive that removes cleanly. Stay-clean edge technology helps keep edges free from dust and grime.\n\nFULL GLUE and NO DOTS, BUBBLES & RAINBOW EFFECT - It has full glue on the entire screen which leaves no dots, no rainbow effect and no bubbles post application of the tempered glass. The tempered glass has strong UV silicon adhesive on the full screen\nPERFECT FIT FULL GLASS & SMOOTH EXPERIENCE - It is a Tempered Glass which covers the full screen of your mobile. It provides edge to edge protection which covers your mobile screen\n100% PROTECTION - It protects your phone from high impact drops, keys in your pockets, metal objects in your bags and other day to day scratches\nCLEAN USAGE - It gives your phone screen protection from finger prints, oil stains, smudges and water drops thanks to the Oleo phobic coating that screen guard comes with. It results in clearer screen\nEASY INSTALLATION - You can install the tempered glass screen protector yourself without any issue\n\n1. ultra-thin premium material\n2. Anti-fouling: Easy to clean oil and fingerprint\n3. Sensitivity and Smoothness: More comfortable touch feeling\n4. Protect your phone from daily damage\n5. Incredible HD vision: High transparency glass',2450.00,NULL,'02ee36e7-365a-40af-a536-6a490abc1fec','2023-10-22 09:01:17','2023-10-22 09:01:17'),('Tecno Spark 10 5G - 6.6\"HD+ - 256GB ROM - 8GB RAM - 4G LTE - Dual SIM - Fingerprint - 5000mAh - Black','Summary META Black / META White / META Blue Faster Internet Experience with 5G D6020 Octa-Core Express Processor 50MP Ultra Clear Rear Camera 8MP Glowing Selfie with Dual Flash 5000mAh Super Battery+18W Fast Charge 256 ROM, 16GB RAM (8GB Extended RAM) 6.6\" HD+ 90Hz Refresh Rate Iconic Design\nSpecification Height: 164.37mm Width:75.45mm Thickness: 8.4