4e919','2023-10-22 08:58:27','2023-10-22 08:58:27'),('Apple iPhone 12 Pro Max - 128GB ROM - 6GB RAM - 6.7-inch -12mp+12mp+12mp - Gold','Hello 5G 5G transforms iPhone with accelerated wireless speeds and better performance on congested networks. Now you can download huge files on the go or stream high-quality HDR movies. Without. All. The. Lag. iPhone also has the most 5G bands of any smartphone so you get 5G in more places. And all that speed opens up amazing possibilities for the future of apps.\nA14 Bionic The only thing even close was our last chip A14 Bionic is the first 5-nanometer chip in the industry, with advanced components literally atoms wide. Forty percent more transistors rev up speeds while increasing efficiency for great battery life. And a new ISP powers Dolby Vision recording — something no pro movie camera, let alone any other phone, can do.\nLiDAR technology Scans the surface of Mars. And now your living room.\nNASA is using LiDAR technology for its next Mars landing. iPhone 12 Pro uses a LiDAR Scanner to measure how long it takes light to reflect back from objects. So it can create a depth map of whatever space you’re in. Because it’s ultrafast and accurate, AR apps can now transform a room into a realistic rainforest or show you how a new sneaker will fit.\nPro camera system A new day for Night mode.\nThe bigger iPhone maxes out the Pro camera system. A 47 percent larger sensor and larger pixels dramatically increase the amount of light gathered on the Wide camera. A new OIS stabilizes the sensor instead of the lens so your shots are steady — even when you’re not. And the new 65 mm Telephoto camera lets you zoom in tighter on portraits.\nApple ProRAW For an absurd amount of creative control\nProRAW gives you all the standard RAW information, along with the Apple image pipeline data. So you can get a head start on editing, with noise reduction and multiframe exposure adjustments already in place — and have more time to tweak color and white balance.\nSuper Retina XDR display An infinity pool of pixels.\nHow do you make our brightest display even better? Make it bigger. A new design with flat edges and our flexible custom OLED allowed us to push the screen’s amazing color, brightness, and contrast right to the very edge.\nTurbo chargeable Magnets align themselves perfectly every time for faster wireless charging.',630000.00,32,'76dfd5c5-9ded-4b39-a109-46d3cec354f9','2023-10-22 09:06:32','2023-10-22 09:06:32'),('Tecno Spark 9t - 6.6\" - 64gb Rom - 4gb Ram - Dual Sim - 5000mah','NETWORK\nTechnology GSM / HSPA / LTE\nBODY\nDimensions 164.3 x 75.6 x 8.7 mm (6.47 x 2.98 x 0.34 in) Weight - SIM Dual SIM (Nano-SIM, dual stand-by)\nDISPLAY\nType IPS LCD, 90Hz Size 6.6 inches, 105.2 cm2 (~84.7% screen-to-body ratio) Resolution 720 x 1600 pixels, 20:9 ratio (~266 ppi density)\nPLATFORM\nOS Android 12, HIOS 8.6 Chipset Mediatek MT6765V/CB Helio G37 (12 nm) CPU Octa-core (4x2.3 GHz Cortex-A53 & 4x1.8 GHz Cortex-A53) GPU PowerVR GE8320\nMEMORY\nCard slot microSDXC Internal 64GB 4GB RAM\nMAIN CAMERA\nTriple 13 MP, f/1.9, 27mm (wide), AF 2 MP, f/2.4, (depth) QVGA, f/2.0 Features Quad-LED flash, HDR Video 1080p@30fps\nSELFIE CAMERA\nSingle 32 MP, (wide) Features Dual-LED flash Video 1080p@30fps\nSOUND\nLoudspeaker Yes 3.5mm jack Yes COMMS\nWLAN Yes Bluetooth Yes GPS Yes, with A-GPS NFC No Radio FM radio USB USB Type-C 2.0, USB On-The-Go\nFEATURES\nSensors Fingerprint (side-mounted), accelerometer, proximity\nBATTERY\nType Li-Po 5000 mAh, non-removable',100900.00,4,'7736b919-d948-4c5f-bd8b-1cbab7dca964','2023-10-22 09:06:35','2023-10-22 09:06:35'),('Infinix Note 12i - X6819 - 128gb + 4gb - 50mp/8mp- Dual Sim- 5000mah- Black','NETWORK\n\nBODY\n\n170.7 x 77.4 x 8.3 mm (6.72 x 3.05 x 0.33 in)\n\n198 g (6.98 oz)\n\nGlass front, plastic frame, plastic back\n\nDual SIM (Nano-SIM, dual stand-by)\n\nDISPLAY\n\nIPS LCD, 90Hz\n\n6.82 inches, 110.5 cm (~83.6% screen-to-body ratio)\n\n720 x 1640 pixels (~263 ppi density)\n\nPLATFORM\n\n