get rid of up to 35dB noise for a quiet listening experience. Oraimo FreePods Pro is your perfect companion for flying, riding trains, and buses. Start from now, embracing hour upon hour of pure listening freedom in this noisy world.\nTransparency for Ambient Awareness – Catch on What’s happening around You\nThe Smart Transparency Mode lets ambient sound in while wearing earbuds. People can stay aware of what is going on around them, or carry out a short conversation without removing earbuds.\nHavyBass Dual EQ – Premium oraimo Sound\nYou can switch between HavyBass Mode and Normal Mode to find the suitable sound effect you need in regards to different rhythms and beats. High-efficiency 8mm drivers made with composite diaphragm provide pristine and beautiful signature sound that can only be heard in Oraimo FreePods Pro.\n4-mic Beamforming Technology – Clear Voice in Call\nBeamforming array and AI Deep Neural Network algorithm reduce the disruptive noise around the caller. Optimized air duct suppresses wind noise. Therefore, FreePods Pro is designed to offer a clear and pure voice in calls.\nUp to 13+30 hrs Playing – Extra Long Playtime\nThanks to the latest technology and large battery capacity, on a full charge, Oraimo FreePods Pro offers 13 hours of power and the handy charging case provides a further 30 hours to keep you going throughout the days.\nIn-ear Detection – Smarter and Easier\nOraimo FreePods Pro comes with inbuilt sensitive sensors that detect when they are being used. Music playback automatically pauses when you take them off and resumes when you put them back on.\nPop-up Notification – Google Fast Pairing\nGoogle Fast Pairing function supports automatic fast pairing with Pop-up notification between FreePods Pro and your Google devices. It is considered compatible with Android 6.0 or above. Your device must also support Google Play services.\nBluetooth 5.2 – Low-latency Game Mode\nSupported by Bluetooth 5.2 transmission technology, low audio latency makes for enjoyable viewing and gaming experience, the sound is always stable.\nNCVM Coating – Finely-crafted Surface\nNCYM(Non-Conductive Vacuum Metallization) coating process is an eco-friendly technique, which provides earbuds with both a long-lasting color surface and a sleek metallic finish.',47027.00,7,'b4703f35-f325-4ca3-924b-da60aae1a4a8','2023-10-22 09:06:21','2023-10-22 09:06:21'),('Samsung Tab A7 Lite - 8.7\" - 32GB ROM - 3GB RAM - Nano Sim - 4G LTE - 5100mAh - Silver','The Samsung Galaxy Tab A7 Lite was announced together with the Galaxy S7 FE on May 27. This smartphone was introduced as a new “go-to alternative” for those looking for a low-cost Android tablet. The Galaxy Tab A7 Lite is a scaled-down version of the original Galaxy Tab A7, which was released in 2020.\nThe Samsung Galaxy Tab A7 Lite is powered by the Android 11 operating system and features the One UI 3.1 user interface. It has a 15.9 aspect ratio and an 8.7-inch WXGA+ (1,340×800 pixels) TFT display. The tablet is powered by an octa-core processor and comes with 3GB or 4GB of RAM. This smartphone is powered by the MediaTek Helio P22T (MT8786T) processor. An 8-megapixel back camera and a 2-megapixel front camera are also included with the Galaxy Tab A7 Lite.\nThe Samsung Galaxy Tab A7 Lite comes with 32GB and 64GB of storage that can be expanded via a microSD card (up to 1TB). 4G LTE (optional), Wi-Fi 802.11ac, Bluetooth v5, GPS, USB Type-C, and a 3.5mm headphone jack are among the connectivity choices. The tablet has dual stereo speakers with Dolby Atmos support.\nAn accelerometer, ambient light sensor, and magnetometer are among the sensors of the Galaxy Tab A7 Lite. The tablet is powered by a 5,100mAh battery that enables 15W rapid charging (a compatible charger is not included).\nThe dimensions of the Samsung Galaxy Tab A7 Lite are 212.5×124.7×8.0mm. The tablet’s Wi-Fi model weighs 366 grams, while the LTE model weighs 371 grams. In addition, the tablet is compatible with Book Cover and C